    public void fn_qr(int i, String data)
    {

        QRCodeEncoder qrCodeEncoder = new QRCodeEncoder();
        String encoding = "Byte";

        if (encoding == "Byte")
        {
            qrCodeEncoder.QRCodeEncodeMode = QRCodeEncoder.ENCODE_MODE.BYTE;
        }
        else if (encoding == "AlphaNumeric")
        {
            qrCodeEncoder.QRCodeEncodeMode = QRCodeEncoder.ENCODE_MODE.ALPHA_NUMERIC;
        }
        else if (encoding == "Numeric")
        {
            qrCodeEncoder.QRCodeEncodeMode = QRCodeEncoder.ENCODE_MODE.NUMERIC;
        }
        try
        {
            int scale = Convert.ToInt16(8);
            qrCodeEncoder.QRCodeScale = scale;
        }
        catch (Exception ex)
        {
            Response.Write("Invalid size!");
            return;
        }
        try
        {
            int version = Convert.ToInt16("7");
            qrCodeEncoder.QRCodeVersion = version;
        }
        catch (Exception ex)
        {
            Response.Write("Invalid version !");
        }

        string errorCorrect = "M";
        if (errorCorrect == "L")
            qrCodeEncoder.QRCodeErrorCorrect = QRCodeEncoder.ERROR_CORRECTION.L;
        else if (errorCorrect == "M")
            qrCodeEncoder.QRCodeErrorCorrect = QRCodeEncoder.ERROR_CORRECTION.M;
        else if (errorCorrect == "Q")
            qrCodeEncoder.QRCodeErrorCorrect = QRCodeEncoder.ERROR_CORRECTION.Q;
        else if (errorCorrect == "H")
            qrCodeEncoder.QRCodeErrorCorrect = QRCodeEncoder.ERROR_CORRECTION.H;

        Bitmap image;
        image = qrCodeEncoder.Encode(data);

        Bitmap h_bmap1 = new Bitmap(410, 450);
        Graphics h_g1 = Graphics.FromImage(h_bmap1);
        h_g1.Clear(System.Drawing.Color.Yellow);
        FontFamily familyName = new FontFamily("맑은 고딕");
        System.Drawing.Font myFont = new System.Drawing.Font(familyName, 28, FontStyle.Regular, GraphicsUnit.Pixel);

        Brush blackBrush = new SolidBrush(System.Drawing.Color.Black);

        h_g1.DrawString("커피쿠폰 1"+ i.ToString(), myFont, blackBrush, new PointF(20, 15));
        h_g1.DrawImage(image, 25, 60);

        h_bmap1.Save("c:\\커피쿠폰\\커피쿠폰"+i.ToString()+".jpg", ImageFormat.Jpeg);
        Response.Write("<image src=\"data:image/png;base64," + su.BitmapToBase64(h_bmap1) + "\">");
    }
